import React, { useState, useEffect } from "react";
import "./Project.scope.css";
import { Outlet, Link } from "react-router-dom";

const Slider = () => {
  return (
    <section className="container-page">
      <div>
      <div className="section">
        <Link to="Education">
          <p>Education</p>
        </Link>
        <Link to="WorkingHistory">
          <p>Working History</p>
        </Link>
        <Link to="SkillSet">
          <p>SkillSet</p>
        </Link>
        <Link to="Project">
          <p>Something I've build</p>
        </Link>
        <Link to="GetInTouch">
          <p>Get In Touch</p>
        </Link>
        <div className="out">
        <Outlet />
        </div>
      </div>
      </div>
    </section>
  );
};

export default Slider;
